import ExpenseItem from "./ExpenseItem";

function Expense(props) {
  return (
    (
        <div>
    <h2>Let's get started!</h2>
      <ExpenseItem>
        {expenses[0].props.title}
        {expenses[0].props.amoount}
        {expenses[0].props.date}
      </ExpenseItem>
    ),
    (
      <ExpenseItem>
        {expenses[1].props.title}
        {expenses[1].props.amoount}
        {expenses[1].props.date}
      </ExpenseItem>
    ),
    (
      <ExpenseItem>
        {expenses[2].props.title}
        {expenses[2].props.amoount}
        {expenses[2].props.date}
      </ExpenseItem>
    ),
    (
      <ExpenseItem>
        {expenses[3].props.title}
        {expenses[3].props.amoount}
        {expenses[3].props.date}
      </ExpenseItem>
    )
    </div>
  )
  )
}
export default Expense;
